%[text] # グループ解析（全参加者の平均）
% data20xx_mmn.mat から年度ごとの data_ave を作成する
list_year = [2016, 2017, 2018, 2022, 2023, 2024, 2025];
base_raw_dir = '/Users/nyanziba/school/脳計測科学/MMN_filtered';
base_out_dir = '/Users/nyanziba/school/脳計測科学/MMN_avg';
EEG_loc_dir = '/Users/nyanziba/school/脳計測科学/MATLAB_EEG/practice2025_lecture/EEG_locs_new.mat'
if ~exist(base_out_dir, 'dir')
    mkdir(base_out_dir);
end

data_by_year = struct();
loaded_years = nan(numel(list_year), 1); % 事前確保
loaded_idx = 0;
data_cell = cell(numel(list_year), 1);    % 年度順に格納

for y = list_year
    in_file = fullfile(base_raw_dir, sprintf('%ddata_filtered_th80.mat', y));
    if ~isfile(in_file)
        warning('入力ファイルが見つかりません: %s', in_file);
        continue;
    end
    S = load(in_file);
    if ~isfield(S, 'data') || ~isfield(S, 'trg')
        warning('data または trg が存在しません: %s', in_file);
        continue;
    end

    % data0: (ch,time,epoch,freq,prt), trg: (epoch,freq,prt)
    [nCh, nTime, ~, nFreq, nPrt] = size(S.data);
    data_ave = nan(nCh, nTime, 2, nFreq, nPrt);

    for f = 1:nFreq
        for p = 1:nPrt
            is_std = S.trg(:, f, p) == 1;
            is_dev = S.trg(:, f, p) == 2;

            if any(is_std)
                data_ave(:, :, 1, f, p) = mean(S.data(:, :, is_std, f, p), 3, 'omitnan');
            end
            if any(is_dev)
                data_ave(:, :, 2, f, p) = mean(S.data(:, :, is_dev, f, p), 3, 'omitnan');
            end
        end
    end

    vname = sprintf('data_ave%d', y);
    eval([vname ' = data_ave;']); %#ok<EVLEQ>
    data_by_year.(sprintf('y%d', y)) = data_ave;
    loaded_idx = loaded_idx + 1;
    loaded_years(loaded_idx) = y;
    data_cell{loaded_idx} = data_ave;

    save(fullfile(base_out_dir, sprintf('%ddata_ave.mat', y)), vname, '-v7.3');
end

% 読み込めた年度を 5 次元目で連結
valid_mask = ~isnan(loaded_years(1:loaded_idx));
loaded_years = loaded_years(valid_mask);
data_cell = data_cell(valid_mask);
data_ave = cat(5, data_cell{:});
save(fullfile(base_out_dir, 'alldata_ave.mat'), "data_ave", '-v7.3');
